import React from 'react';
import logo from './logo.svg';
import './App.css';
import CamposCadastro from './CamposCadastro.js'

function App() {
  return (
    <div className="App">
      <header className="row justify-content-right">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Api UI
        </p>
        <CamposCadastro></CamposCadastro>
      </header>
    </div>
  );
}

export default App;
